[[package]]
name = "adafruit-blinka"
version = "8.9.0"
description = "CircuitPython APIs for non-CircuitPython versions of Python such as CPython on Linux and MicroPython."
category = "main"
optional = false
python-versions = ">=3.7.0"

[package.dependencies]
adafruit-circuitpython-typing = "*"
Adafruit-PlatformDetect = ">=3.13.0"
Adafruit-PureIO = ">=1.1.7"
pyftdi = ">=0.40.0"

[[package]]
name = "adafruit-circuitpython-busdevice"
version = "5.2.3"
description = "CircuitPython bus device classes to manage bus sharing."
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
Adafruit-Blinka = ">=7.0.0"
adafruit-circuitpython-typing = "*"

[[package]]
name = "adafruit-circuitpython-dht"
version = "3.7.8"
description = "CircuitPython support for DHT11 and DHT22 type temperature/humidity devices"
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
Adafruit-Blinka = "*"

[[package]]
name = "adafruit-circuitpython-requests"
version = "1.12.11"
description = "A requests-like library for web interfacing"
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
Adafruit-Blinka = "*"

[[package]]
name = "adafruit-circuitpython-typing"
version = "1.8.3"
description = "Types needed for type annotation that are not in `typing`"
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
Adafruit-Blinka = "*"
adafruit-circuitpython-busdevice = "*"
adafruit-circuitpython-requests = "*"
typing-extensions = ">=4.0,<5.0"

[[package]]
name = "adafruit-platformdetect"
version = "3.37.0"
description = "Platform detection for use by libraries like Adafruit-Blinka."
category = "main"
optional = false
python-versions = ">=3.7.0"

[[package]]
name = "adafruit-pureio"
version = "1.1.9"
description = "Pure python (i.e. no native extensions) access to Linux IO    including I2C and SPI. Drop in replacement for smbus and spidev modules."
category = "main"
optional = false
python-versions = ">=3.5.0"

[[package]]
name = "alabaster"
version = "0.7.12"
description = "A configurable sidebar-enabled Sphinx theme"
category = "main"
optional = true
python-versions = "*"

[[package]]
name = "argcomplete"
version = "2.0.0"
description = "Bash tab completion for argparse"
category = "main"
optional = true
python-versions = ">=3.6"

[package.dependencies]
importlib-metadata = {version = ">=0.23,<5", markers = "python_version == \"3.7\""}

[package.extras]
test = ["wheel", "pexpect", "flake8", "coverage"]

[[package]]
name = "astroid"
version = "2.11.7"
description = "An abstract syntax tree for Python with inference support."
category = "main"
optional = true
python-versions = ">=3.6.2"

[package.dependencies]
lazy-object-proxy = ">=1.4.0"
typed-ast = {version = ">=1.4.0,<2.0", markers = "implementation_name == \"cpython\" and python_version < \"3.8\""}
typing-extensions = {version = ">=3.10", markers = "python_version < \"3.10\""}
wrapt = ">=1.11,<2"

[[package]]
name = "atomicwrites"
version = "1.4.1"
description = "Atomic file writes."
category = "main"
optional = true
python-versions = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*"

[[package]]
name = "attrs"
version = "22.1.0"
description = "Classes Without Boilerplate"
category = "main"
optional = false
python-versions = ">=3.5"

[package.extras]
dev = ["coverage[toml] (>=5.0.2)", "hypothesis", "pympler", "pytest (>=4.3.0)", "mypy (>=0.900,!=0.940)", "pytest-mypy-plugins", "zope.interface", "furo", "sphinx", "sphinx-notfound-page", "pre-commit", "cloudpickle"]
